                    Canvas.SetTop(_points[_counter].point, coord.Y - 5);
                    CanvasImage.Children.Add(_points[_counter].point);
                    _points[_counter].Coor = coord;
                    int col = 0, row = 0;
                    fun(ref col, ref row);
                    _points[_counter].Column = col;
                    _points[_counter].Row = row;
